import React from 'react'
import products from '../products'
import {Row, Col} from 'react-bootstrap'
import product from '../products'

//it's saying Product is not defined how do i fix this?

const HomeScreen = () => {
  return (
    <>
        <h1>Latest Products</h1>
        <Row>
            {products.map(product => (
                <Col sm={12} md={6} lg={4} xl={3}>
                    <Product name={product.name} image={product.image} price={product.price} rating={product.rating} numReviews={product.numReviews} />
                <h3>{product.name}</h3></Col> ))}
        </Row>
    </>
  )
}

export default HomeScreen
